Verenigde Staten
Drama / Avontuur
101 minuten

goed

met Shohreh Aghdashloo, Keisha Castle-Hughes en Oscar Isaac

Deze film vertelt het verhaal van Jozef en Maria vanaf twee jaar voor de geboorte van Jezus. Door een wonder wordt Maria zwanger, 
en ze trekken richting Bethlehem, waar haar kind Jezus wordt geboren.
